t to queue and process queue if not blocked\nvar event_name = cb_obj.event_name;\nif (event_name === undefined) {\n  // we are a widget not an event... fake a key.\n  event_name = Object.keys(data).join(',');\n}\ndata['comm_id'] = \"0d9b4fbde64840dd98c146b531516a3c\";\nvar timeout = comm_status.time + 20000;\nif ((comm_status.blocked &amp;&amp; (Date.now() &lt; timeout))) {\n  comm_status.event_buffer.unshift([event_name, data]);\n} else {\n  comm_status.event_buffer.unshift([event_name, data]);\n  setTimeout(function() { process_events(comm_status); }, 20);\n  comm_status.blocked = true;\n  comm_status.time = Date.now()+20;\n}\n"},"id":"1549","type":"CustomJS"},{"attributes":{},"id":"1594","type":"BasicTickFormatter"},{"attributes":{},"id":"1546","type":"BasicTickFormatter"},{"attributes":{"data":{"x":{"__ndarray__":"eBF9D8/B7j8lM0VqqkSuv9oL8N8LuuA/1qaU1jxi4D8EJ3CJVsXpP7uX9OIbtvc/7xjNeq420z/f58lNJVjGv2NzgX7RKOQ/kv6L7vwk0L9cPYJKQ7rwP3S6XY+cePo/trdeltkD578W1iXTgCfRv2xtfPPPLdc/tB5j3arg3j8MGBBKvXDbPztdLdX2t86/jTUwZTUb6D+7xSERZSbrP7ygkK2B6NE/w7MJLKUXyj9DcBCEahfpP4T8RJpo3PM/DfkkKpI72T97X0Y2ETHwPzogLqC/9Nk/JhVdfJAqzz/Yc5/6Zr+XPyX7+DtyouA/i+qhdXvg4D+8owzBswjhPywXpiv5Avg/z4/vDKoW9z+j4oldCRPzP/e40MvU/t0/8WczdNdTrb+msQeoJw/Nv8eosuMu69q/+ZtBU0W32r9Q014ZY4zhP1HLp29tYfA/oKOGq8RzwT+l278q2SjTP/u9SmsSbvM/pScbbYxq1z/J0VM4q1rxvzjj+6k0DeG/MkcqnPzc178lwdZ2NUruPyijbQ5TXNS/xefF3JiK9j9Y43MjJnLpP3a3R6zkm+g/EsWk3ck65z+dSyLRsPn8P0v/vMFX8so/ryGPFrnD8z+YNyUL60/WP1gsIW6ENvM/VzZeH7HM5T8diS6EuQXkP4WvejcosvY/xyswF7fBnj+AoqEkaujqP0iiGzzlluU/cF5CZXQJ8T/GLDebsOvwvw6E1jvUTpM/ajSGsyTo7z9bYeA2RiXmP1Azfmi389w/uTQt52Xk0b+KNlZxIez3P3NYJdLDHe4/qgaixKVQ8T8UIeLVFFz5P90ZB3oJEPk/Y4EWT1FaoL+4ZwGsum+6P1s4sLzc4PA/BZzYG9z38T9NTdD0d5D9P8zqe/W09ec//oaU7Jyk5j8yQ/yREDfnP/YPmYUgh/Q/n4HL7mZi0z8k6MOXW37yP6ajMSplpvs/O9GoMwjJ/z9m/nmvBo3zPxcYDE/lEea/9s4gU2CG4D/p0Bs29W/xv3CQheP6GdO/KBDkl28I5j8huh2+RBbePzFg89gc5vk/h5ZU0XTv8r/lN4sEvUTQPySbSaqzG+o/kCHO+yOr8D8ziER/43bjv70QXAApdNk/NIPYPEyL5T9jQTpiXlzRPyQnDrmiq50/xbSrc2tk5r/Z8glX/r
